mapper.select:
select 

from TRS_PROVISION_PROCESS_OD
where ACC_BRANCH = #{ACC_BRANCH}
  and BRANCH_CODE = #{BRANCH_CODE}
  and CIF_SUB_NO = #{CIF_SUB_NO}
  and COMP_CODE = #{COMP_CODE}
  and CURRENCY_CODE = #{CURRENCY_CODE}
  and GL_CODE = #{GL_CODE}
  and PROCESS_NBR = #{PROCESS_NBR}
  and SL_NO = #{SL_NO}

mapper.delete:
delete from TRS_PROVISION_PROCESS_OD
where ACC_BRANCH = #{ACC_BRANCH}
  and BRANCH_CODE = #{BRANCH_CODE}
  and CIF_SUB_NO = #{CIF_SUB_NO}
  and COMP_CODE = #{COMP_CODE}
  and CURRENCY_CODE = #{CURRENCY_CODE}
  and GL_CODE = #{GL_CODE}
  and PROCESS_NBR = #{PROCESS_NBR}
  and SL_NO = #{SL_NO}
